use tessellate::mesh::attributes::Attributes;
use tessellate::mesh::parts::plane::Plane; fn main(){ // Create a plane from a normal vector and a point let normal = Vec3::new(0.0, 1.0, 0.0); let point = Vec3::new(0.0, 0.0, 0.0); let plane = Plane::new(normal, point); // Calculate the distance from a point to the plane let distance = plane.distance(Vec3::new(0.0, 2.0, 0.0)); assert_eq!(distance, 2.0);
